import React, { Component } from 'react'

export class learnUseState extends Component {
    constructor(porps){
        super(this.props);
        this.state={
            count:0
        };
    }
    render() {
        return (
            <div>
                <p>You clicked {this.state.count} times</p>
                <button onClick={()=> this.setState({count:this.state.count+1})}></button>
            </div>
        )
    }
}
